import React from 'react';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import IconButton from '@mui/material/IconButton';
import MenuIcon from '@mui/icons-material/Menu'; // Cambia este icono según tus necesidades
import AccountCircle from '@mui/icons-material/AccountCircle'; // Cambia este icono según tus necesidades

const HeaderApp = () => {
    return (
        <AppBar position="fixed" style={{ backgroundColor: 'white', color: '#222223', zIndex: 1000 }}>
            <Toolbar>
                <IconButton edge="start" color="inherit" aria-label="menu">
                    <MenuIcon /> {/* Icono a la izquierda */}
                </IconButton>
                <Typography variant="h6" style={{ flexGrow: 1 }}>
                    Nombre de tu App {/* Texto */}
                </Typography>
                <IconButton color="inherit">
                    <AccountCircle /> {/* Icono a la derecha */}
                </IconButton>
            </Toolbar>
        </AppBar>
    );
};

export default HeaderApp;
